$.when($.ready).then(function(){fetch("https://mobile.landx.id/mobile/landing_data").then(e=>e.json()).then(e=>{numeral.register("locale","id",{delimiters:{thousands:".",decimal:","},abbreviations:{thousand:"Ribu",million:"Juta",billion:"Miliar",trillion:"Trilyun"}}),numeral.locale("id"),$(".property-count").text(e.property_count),$(".registered-users").text(numeral(e.registered_users).format("0,0")),$(".raised-funds").text(numeral(e.raised_fund+272e7).format("0.00 a")),$(".dividend-payout").text(numeral(parseInt(e.dividend_payout)).format("0.00 a"))})});